import React from "react";

export const Footer = () => {
  return (
    <footer className="flex p-5 justify-center items-center border-t-2 border-gray-300">
      <h2 className="text-green-500 text-4xl text-start font-semibold px-5">
        <a href="/#">MovieDB</a>
      </h2>

      <p>Made with React | Clement</p>
    </footer>
  );
};

export default Footer;
